  const { getLoading, setLoading } = useState(true);
  const { getContacts, setContacts } = useState([]);
  return (
    <div className="App">
      <Navbar />
      <Contacts contacts={getContacts} loading={getLoading} />
    </div>
  );
};

export default App;
